import Layout from "../components/Layout";

const price = () => (
    <Layout>
        <section class="hero is-fullheight" style="background-color: 	#181c1f;">
            <div class="container" style="display: flex; justify-content: center; align-items: center;">
                <img src="price.jpg" />
            </div>
        </section>
    </Layout>
)

export default price;
